import './App.css';


import NavBar from './components/navbar/Navbar';


function App() {
  return (
    <body>
    <div className="App">

      <header><NavBar/></header>

      <div className="section1">
        <h1>Being Green The Change Our Enviorment Needs</h1>
        <h2>Find out how Urban Greening can help</h2>
        <img src={require('./images/urbangreen.jpeg')} />
      </div>

      <div className="section2"> 
        <h1>What is Urban Greeening?</h1>

        <div class="leftdiv">Biodiversity and green spaces</div>
        <div class="rightdiv">Biodiversity and green spaces</div>
        <div class="middle">Biodiversity and green spaces</div>
      </div>







    </div>
    </body>
  );
}

export default App;
